import React from "react";
import { Link, Outlet } from "react-router-dom";

const Homepage = () => {
  return (
    <div>
      <nav id="navbar">
        <Link className="navitem" to="AboutMe">
          About Me Bitch
        </Link>
        <Link className="navitem" to="Payment">
          Payment
        </Link>
        <Link className="navitem" to="Register">
          Register
        </Link>
        <Link className="navitem" to="AllPosts">
          All Items
        </Link>
      </nav>
      <button id="welcometext">WELCOME MF</button>
      <Outlet />
    </div>
  );
};

export default Homepage;
